import React from "react";
import "./Header.css";
import avatar from "../../asset/images/AvatarMaker.png";

const Header = () => {
  return (
    <header className="header">
      <nav>
        <ul>
          <li></li>
        </ul>
      </nav>
      <section className="avatarHeader">
        <img id="avatar" src={avatar} alt="Mon avatar" />
        <div>
            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Laborum amet vitae perspiciatis eum ea dolores facilis animi vero quia maiores eos, fugit provident, consequatur debitis soluta, neque omnis natus reiciendis!</p>
        </div>
      </section>
    </header>
  );
};

export default Header;
